package test.java.pt.pokemon;


import main.java.pt.pokemon.Game;
import org.junit.Before;
import org.junit.Test;
import static org.junit.Assert.assertEquals;

public class TestJunit {
    //declarar variaveis necessarias para correr os testes
    Game myGame;

    //metodo utilizado para inicializar as variaveis necessarias para correr os testes
    @Before
    public void initialize() {
        myGame = new Game();
    }

    @Test
    public void testOneMovement() {
        int result = 2;
        assertEquals(myGame.play("E"), result);
    }


    @Test
    public void testCircularMovement() {
        int result = 4;
        assertEquals(myGame.play("NESO"), result);
    }

    @Test
    public void testUpAndDownMovement() {
        int result = 2;
        assertEquals(myGame.play("NSNSNSNSNS"), result);
    }

    @Test
    public void testCircularMovementManyCircles() { //51 200 caracteres com SENO repetido varias vezes em sequencia
        int result = 4;
        assertEquals(myGame.play(""), result);
    }

    @Test
    public void testOnlyMovingSouth() {
        int result = 20;
        assertEquals(myGame.play("SSSSSSSSSSSSSSSSSSS"), result);
    }

    @Test
    public void testOnlyMovingNorth() {
        int result = 20;
        assertEquals(myGame.play("NNNNNNNNNNNNNNNNNNN"), result);
    }

    @Test
    public void testUnknownMovement() {
        int result = -1;
        assertEquals(myGame.play("L"), result);
    }

}
